package gokit

import (
	"fmt"
	"go/token"
	"math"
	"testing"
	"time"
)

func TestStack(t *testing.T) {
	fmt.Println(Stack())
}

func TestPanicStack(t *testing.T) {
	defer fmt.Println(PanicStack())

	panic("errror.")
}

var emptyString = ""

type S struct {
	A int
	B int
}

type T struct {
	S
	C int
}

func TestDump(t *testing.T) {
	//Dump(nil)
	fmt.Println("---------------------------------------------------")
	Dump(token.STRING)
	fmt.Println("---------------------------------------------------")
	Dump(&emptyString)
	fmt.Println("---------------------------------------------------")
	Dump([3]int{1, 2, 3})
	fmt.Println("---------------------------------------------------")
	Dump([]int{1, 2, 3})
	fmt.Println("---------------------------------------------------")
	Dump(&[][]int{[]int{1, 2, 3}, []int{1, 2, 3}, []int{1, 2, 3}})
	fmt.Println("---------------------------------------------------")
	mapName := make(map[string]int)
	mapName["satu"] = 1
	mapName["dua"] = 2
	Dump(mapName)
	fmt.Println("---------------------------------------------------")
	Dump(T{S{1, 2}, 3})
}

func TestGetProPath(t *testing.T) {
	fmt.Println(GetProPath())
}

func TestFileExist(t *testing.T) {
	fmt.Println(FileExist("utile_test.go"))
	fmt.Println(FileExist("utile_test1111.go"))
}

func TestStrToTime(t *testing.T) {
	fmt.Println(StrToTime("2017-10-16 10:00:50"))
}

func TestMillisecond(t *testing.T) {
	fmt.Println(Millisecond())
}

func TestGetDayInMon(t *testing.T) {
	var year int
	year = 2004
	fmt.Println("year:", year)
	for i := 1; i <= 12; i++ {
		fmt.Print(i, "--", GetDayInMon(year, i), "  ")
	}
	fmt.Println("")

	year = 1900
	fmt.Println("year:", year)
	for i := 1; i <= 12; i++ {
		fmt.Print(i, "--", GetDayInMon(year, i), "  ")
	}
}

func TestIsNaN(t *testing.T) {
	var val float64
	val = math.NaN()
	fmt.Println(IsNaN(val))
}

func TestTableFile(t *testing.T) {
	tbF := NewTableFile("testtablefile.txt", "	")
	if nil == tbF {
		return
	}
	for !tbF.Eof() {
		fmt.Println(tbF.ReadInt("ID", 0), "  ", tbF.ReadString("Name", ""), "  ", tbF.ReadFloat("Float", 5.0))
		tbF.Next()
	}
}

func TestIni(t *testing.T) {
	ini := NewIni("initest.ini")
	if nil == ini {
		return
	}
	fmt.Println(ini.ReadInt("Main", "id", 0))
	fmt.Println(ini.ReadFloat("Main", "timeout", 0.0))
	fmt.Println(ini.ReadString("Main", "name", ""))

	fmt.Println(ini.ReadString("Log", "name", ""))
}

func TestIdworker(t *testing.T) {
	idWorker, _ := NewIdWorker(1, 2)
	for i := 0; i < 20; i++ {
		id, _ := idWorker.GetId()
		fmt.Println(id)
	}
}

func TestLogger(t *testing.T) {
	log := NewLogger(LV_DEBUG, "log.txt")
	if nil == log {
		return
	}

	log.Log(LV_DEBUG, "LV_DEBUG")
	log.Log(LV_INFO, "LV_INFO")
	log.Log(LV_WARN, "LV_WARN")
	log.Log(LV_ERROR, "LV_ERROR")
	log.Log(LV_SYS, "LV_SYS")
	time.Sleep(time.Second)
	log.Close()
}

