func TestHashRing(t *testing.T) {
	ring := NewHashRing()
	ring.Add("titanic", 32)
	ring.Add("terminator2018", 24)
	ring.Add("Xenomorph", 1)
	ring.Add("True Lies", 10)
	ring.Add("avantar", 48)

	fmt.Println("node number:", ring.NodeNum())

	for i := 0; i < 100; i++ {
		obj1 := fmt.Sprintf("James.km%v", i)
		obj2 := fmt.Sprintf("json .cpp%v", i)
		node1, _ := ring.Get(obj1)
		node2, _ := ring.Get(obj2)
		fmt.Println(node1, "    ", node2)
	}

	ring.Remove("Xenomorph")

	fmt.Println("after delete, node number:", ring.NodeNum())
}
